function mainact(w){
	$('.profilesidebar,.profile-bar.grid,.profile-menu').hide();
	$('.played-sidebar').show();
	if(w == 0)
	{
		$('.ui.first.grid').show();
		$('.ui.second.grid').hide();
		$('.ui.third.grid').hide();

	}
	else if(w == 1)
	{
		$('.ui.second.grid').show();
		$('.ui.first.grid').hide();
		$('.ui.third.grid').hide();
	}
	else if(w == 2)
	{
		$('.ui.third.grid').show();
		$('.ui.first.grid').hide();
		$('.ui.second.grid').hide();
	}
}

